&lt;p&gt;I hadn't planned on posting any more images from Haiti until this disaster hit. The house that we stayed at just 2 weeks ago is completely leveled and some of the people that stayed in the same guest house as us have died. The good news is that the orphanage that we worked in is still standing and the babies are all safe.&lt;br /&gt;
&lt;br /&gt;
The chaos wrought in the desperately poor country of Haiti is hard to fathom, even as we watch it unfold on our TV screens and laptops. It’s destruction on a colossal scale.&lt;br /&gt;
Yet the world is not standing idly by. President Barack Obama promised an all-out rescue and humanitarian effort, including a 2,000-member Marine unit. “We have to be there for them in their hour of need,” the president said.&lt;br /&gt;
&lt;br /&gt;
The United Nations released $10 million in emergency funds. Canada pledged $4.8 million. The Irish telecommunications company Digicel donated $5 million in aid and to repair the country’s damaged phone network. And there have been many, many more. &lt;br /&gt;
&lt;br /&gt;
The American Red Cross has ushered in an outpouring of donations large and small, including countless $10 pledges sent via text message. The $10 text pledges alone — a Red Cross initiative backed by the U.S. State Department — banked nearly $1 million by the end of Wednesday. For onlookers with heavy hearts, such texts are a hedge against helplessness. And they’re a symbol to the millions of suffering Haitians that we’re aware of their needs. And we care.&lt;br /&gt;
&lt;br /&gt;
Stats provided by MPNnow.com&lt;/p&gt;

