&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292626219/" title="Injured Haitian child"&gt;&lt;img src="http://farm5.static.flickr.com/4017/4292626219_4b846e414d_m.jpg" width="178" height="240" alt="Injured Haitian child" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;An injured boy waits for medical care at a hospital three days after a major earthquake hit the Haitian capital Port-au-Prince, January 15, 2010.&lt;br /&gt;
&lt;br /&gt;
REUTERS/Carlos Barria HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292626351/" title="Food distribution in Port-au-Prince"&gt;&lt;img src="http://farm5.static.flickr.com/4015/4292626351_4804207820_m.jpg" width="240" height="160" alt="Food distribution in Port-au-Prince" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;People try to get food at a food distribution center in Port-au-Prince January 17, 2010. World leaders pledged aid to rebuild a devastated Haiti, but on the streets of its wrecked capital earthquake survivors were still waiting on Sunday for the basics: food, water and medicine. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Kena Betancur HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292626731/" title="Haiti quake: Looters"&gt;&lt;img src="http://farm3.static.flickr.com/2792/4292626731_93827e92f1_m.jpg" width="240" height="160" alt="Haiti quake: Looters" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Looters run with goods from a destroyed store in downtown Port-au-Prince January 17, 2010. World leaders pledged aid to rebuild a devastated Haiti, but on the streets of its wrecked capital earthquake survivors were still waiting on Sunday for the basics: food, water and medicine. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Carlos Barria HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292626887/" title="Riot in Port-au-Prince"&gt;&lt;img src="http://farm5.static.flickr.com/4041/4292626887_3a2c6a5e72_m.jpg" width="240" height="163" alt="Riot in Port-au-Prince" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;People run from police during riots with looters in downtown Port-au-Prince January 17, 2010. U.S. troops will help keep order on Haiti's increasingly lawless streets, the country's president said on Sunday as desperate earthquake survivors waited for food, water and medicine. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Carlos Barria HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292627057/" title="Haitian child in hospital"&gt;&lt;img src="http://farm5.static.flickr.com/4019/4292627057_6d0e7eb4d0_m.jpg" width="240" height="160" alt="Haitian child in hospital" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A couple takes care of their child with a broken arm and leg at a makeshift hospital in Port-au-Prince January 16, 2010. Haitian authorities are rounding up troublemakers to prevent sporadic looting from turning into wider violence in the aftermath of the Caribbean nation's devastating earthquake, a senior security official said. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Jorge Silva HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292628625/" title="Hilary Clinton in Haiti"&gt;&lt;img src="http://farm5.static.flickr.com/4070/4292628625_f9c780c236_m.jpg" width="240" height="160" alt="Hilary Clinton in Haiti" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;U.S. Secretary of State Hillary Clinton (L) speaks beside Haiti President Rene Preval (R) during her visit to Port-au-Prince January 16, 2010. Clinton assured Haiti's quake-ravaged people on Saturday the United States would work with their government to ensure the country emerges &amp;quot;stronger and better&amp;quot; after this week's disaster. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Eduardo Munoz HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292629089/" title="Haiti quake "&gt;&lt;img src="http://farm3.static.flickr.com/2739/4292629089_5d1f59b3ff_m.jpg" width="240" height="158" alt="Haiti quake " /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A Haitian woman prays as she attends an open air Catholic mass next to the ruins of a cathedral in Port-au-Prince January 17, 2010. World leaders pledged aid to rebuild Haiti after what the United Nations called the worst humanitarian crisis in decades, but earthquake survivors were still waiting on Sunday for food, water and medicine.  &lt;br /&gt;
&lt;br /&gt;
REUTERS/Jorge Silva HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4292629403/" title="Haiti earthquake aftermath"&gt;&lt;img src="http://farm5.static.flickr.com/4071/4292629403_c47e978405_m.jpg" width="240" height="142" alt="Haiti earthquake aftermath" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;People walk on a debris-covered street in Port-au-Prince January 17, 2010. World leaders have pledged massive assistance to rebuild Haiti after the earthquake killed as many as 200,000 people, but five days into the crisis aid distribution was still random, chaotic and minimal. &lt;br /&gt;
&lt;br /&gt;
REUTERS/Daniel Aguilar HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4293369560/" title="Catholic mass in Haiti"&gt;&lt;img src="http://farm5.static.flickr.com/4004/4293369560_5eb8da11bf_m.jpg" width="240" height="160" alt="Catholic mass in Haiti" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;A woman cries as she attends a Catholic mass after the earthquake in Port-au-Prince January 17, 2010. World leaders pledged aid to rebuild Haiti after what the United Nations called the worst humanitarian crisis in decades, but earthquake survivors were still waiting on Sunday for food, water and medicine.  &lt;br /&gt;
&lt;br /&gt;
REUTERS/Kena Betancur HAITI&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/britishredcross/"&gt;British Red Cross.&lt;/a&gt; posted a photo:&lt;/p&gt;
&lt;p&gt;&lt;a href="http://www.flickr.com/photos/britishredcross/4293371206/" title="Ban Ki-Moon visiting Haiti"&gt;&lt;img src="http://farm5.static.flickr.com/4002/4293371206_5ece023b15_m.jpg" width="240" height="169" alt="Ban Ki-Moon visiting Haiti" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;U.N. Secretary-General Ban Ki-moon inspects the site of the former headquarters of the United Nations Stabilization Mission in Haiti (MINUSTAH) in Port-au-Prince, as rescue workers work to free a man in the background, January 17, 2010. World leaders have pledged massive assistance to rebuild Haiti after the earthquake killed as many as 200,000 people, but five days into the crisis aid distribution was still random, chaotic and minimal. The man was eventually rescued by the rescue workers.&lt;br /&gt;
&lt;br /&gt;
REUTERS/Louis Charbonneau  HAITI&lt;/p&gt;

