&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dfid/4283982753/" title="UK firefighters meet rescued girl in Haiti"&gt;&lt;img src="http://farm3.static.flickr.com/2689/4283982753_cd086d742e_m.jpg" width="240" height="180" alt="UK firefighters meet rescued girl in Haiti" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Dean Harris (l) and Rudy Parkes (r) from West Midlands Fire Service, meet two-year-old Mia, who they rescued from a collapsed kindergarten in Port-au-Prince, Haiti.&lt;br /&gt;
&lt;br /&gt;
(See video of the rescue from ITN News on YouTube: &lt;a href="http://www.youtube.com/watch?v=1cXlfvnrVwI)" rel="nofollow"&gt;www.youtube.com/watch?v=1cXlfvnrVwI)&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
Dean and Rudy were part of the 64 strong UK search and rescue team that travelled to Haiti to help find survivors in the aftermath of the devastating earthquake. This evening (Sunday), they both returned to the meet the child they helped pulled out of a collapsed kindergarten.&lt;br /&gt;
&lt;br /&gt;
Mia, aged two, was trapped for three days when a local boy directed the search team to her house. After three hours of painstaking rescue work, she was pulled out and treated for dehydration. She is now playing with her family near her home, just yards from the kindergarten In which she was trapped.&lt;br /&gt;
&lt;br /&gt;
For latest updates on how the UK is helping in Haiti, please visit &lt;a href="http://www.dfid.gov.uk/haiti-earthquake" rel="nofollow"&gt;www.dfid.gov.uk/haiti-earthquake&lt;/a&gt;.&lt;br /&gt;
&lt;br /&gt;
Image credit: Michael Haig / Department for International Development&lt;br /&gt;
&lt;br /&gt;
