&lt;p&gt;&lt;a href="http://www.flickr.com/photos/dfid/4371059542/" title="First raft from UK aid shipment lands at Verreux Port near Port-au-Prince"&gt;&lt;img src="http://farm3.static.flickr.com/2802/4371059542_54a572e36e_m.jpg" width="240" height="182" alt="First raft from UK aid shipment lands at Verreux Port near Port-au-Prince" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The first raft ferrying UK aid to Haiti’s shore arrives at Verreux Port, near Port-au-Prince.&lt;br /&gt;
&lt;br /&gt;
The 100-ton raft – made up of connecting pontoons – is being used to transfer essential supplies from the Royal Fleet Auxiliary ship, Largs Bay, anchored off-shore.&lt;br /&gt;
&lt;br /&gt;
These 4x4s will help to carry humanitarian staff and supplies to the people of Haiti.&lt;br /&gt;
&lt;br /&gt;
Get the full story of the ship’s arrival: &lt;a href="http://www.dfid.gov.uk/Media-Room/News-Stories/2010/Aid-ship-arrives-in-Haiti-and-sets-to-work/" rel="nofollow"&gt;www.dfid.gov.uk/Media-Room/News-Stories/2010/Aid-ship-arr...&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
This photo was taken by DFID’s Michael Haig who is on the ground in Haiti. Follow his updates on Twitter: &lt;a href="http://www.twitter.com/dfid_uk" rel="nofollow"&gt;www.twitter.com/dfid_uk&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
To find out how the UK is helping in Haiti, please visit &lt;a href="http://www.dfid.gov.uk/haiti-earthquake" rel="nofollow"&gt;www.dfid.gov.uk/haiti-earthquake&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
If you wish to help, please consider donating money to the UK's Disaster Emergencies Committee Appeal for Haiti: &lt;a href="http://www.dec.org.uk" rel="nofollow"&gt;www.dec.org.uk&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
Credit: Department for International Development / Michael Haig&lt;/p&gt;

