The boy was found by himself outside the hospital, just after the earthquake.&lt;br /&gt;
Other patients are helping him and share their water and food. In addition the psychosocial team from the Red Cross Red Crescent is taken care of him, and making sure that he is rehydrated, and will be taken care of at a local orphanage. &lt;br /&gt;
&lt;br /&gt;
The needs of the patients at the General Hospital in Port-au-Prince are enormous, both medical, physical and psycho-social.&lt;br /&gt;
&lt;br /&gt;
Red Cross medical teams from Norway, Canada, Israel and Haiti are working at the clinic, including specially trained volunteers who are attending to both the patients and the  hospital personals psychological needs after the earthquake.&lt;br /&gt;
