&lt;p&gt;&lt;a href="http://www.flickr.com/photos/lunarandplanetaryinstitute/4455175684/" title="ASTER Captures Clear Sky Image of Haiti Earthquake Region"&gt;&lt;img src="http://farm3.static.flickr.com/2755/4455175684_5e2f90ca43_m.jpg" width="229" height="240" alt="ASTER Captures Clear Sky Image of Haiti Earthquake Region" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;On Jan. 21, 2010, the Advanced Spaceborne Thermal Emission and Reflection Radiometer (ASTER) instrument on NASA's Terra spacecraft captured this simulated natural color image of the Port-au-Prince, Haiti, region, nine days after a magnitude 7.0 earthquake struck the region, causing massive damage and loss of life. In this latest image, the large white object visible in the bay in the left center is the U.S. Navy hospital ship Comfort that reached Haiti on Jan. 20. The 275-by-33-meter (100-by-900 foot) ship has a total patient capacity of 1,000 beds and has 12 operating rooms. ASU-IPF-3062&lt;/p&gt;

