&lt;p&gt;This week's issue of &lt;a href="http://sportsillustrated.cnn.com/" rel="nofollow"&gt;&lt;i&gt;Sports Illustrated&lt;/i&gt;&lt;/a&gt; features a story on Joe Gaetjens -- the Haitian soccer player who scored the winning goal for the U.S. in a 1950 World Cup game against England. Gaetjens was murdered by the Tonton Macoutes in 1964, but while Josh and I were in Port-au-Prince we tracked down his sister and cousin (and visited what remains of the prison where he once was held). Scans of the full story with Josh's reporting and my photos are posted &lt;a href="http://dan.iella.net/si/" rel="nofollow"&gt;here&lt;/a&gt; and the story (text-only) is up at SI.com &lt;a href="http://sportsillustrated.cnn.com/vault/article/magazine/MAG1166756/index.htm" rel="nofollow"&gt;here&lt;/a&gt;.&lt;/p&gt;

