&lt;p&gt;&lt;a href="http://www.flickr.com/people/oddwick/"&gt;Todd Huffman&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/oddwick/4768687556/" title="Vector Calculus"&gt;&lt;img src="http://farm5.static.flickr.com/4135/4768687556_38e9295380_m.jpg" width="240" height="180" alt="Vector Calculus" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Trevor and I were on a walk through Cité Soleil, and we went into a church made of tin roofing materia.  There, on desks made from scrap lumber, several teens were teaching eachother vector calculus (that's Calc III).  They have no calculus teacher, and are able to do this because they found a textbook in a donation pile.  This picture was not posed, and they didn't know we were coming, this was a totally random interaction.&lt;br /&gt;
&lt;br /&gt;
I'm putting together a laptop to send back to them loaded with learning materials from MIT's OpenCourseWare and other sources.  If you'd like to contribute let me know and I'd be happy to include other items in the donation.&lt;br /&gt;
&lt;br /&gt;
For reference, here's what Wikipedia has to say about their home:&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://en.wikipedia.org/wiki/Cité_Soleil" rel="nofollow"&gt;en.wikipedia.org/wiki/Cité_Soleil&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
&amp;quot;Cité Soleil (Kreyol: Site Solèy, English: Sun City) is a very densely populated commune located in the Port-au-Prince metropolitan area in Haiti. The lawless Cite Soleil is regarded by many as one of the most dangerous places on earth. It was developed as a shanty town. Most of its estimated 200,000 to 400,000 residents live in extreme poverty.[1] The area is generally regarded as one of the poorest and most dangerous areas of the Western Hemisphere's poorest country; it is one of the biggest slums in the Northern Hemisphere. There is little to no police presence, no sewers, no stores, and little to no electricity.[2]&lt;br /&gt;
&lt;br /&gt;
The neighborhood, originally designed to house manual laborers for a local Export Processing Zone (EPZ), quickly became home to squatters from around the countryside looking for work in the newly constructed factories. After a 1991 coup d'état deposed President Jean-Bertrand Aristide, a boycott of Haitian products closed the EPZ.[3] Cité Soleil was soon thrust into extreme poverty and persistent unemployment, with high rates of illiteracy.[2]&lt;br /&gt;
&lt;br /&gt;
Armed gangs roam the streets. Murder, rape, kidnapping, looting, and shootings are common as every few blocks is controlled by one of more than 30 armed factions.[4] The area has been called a &amp;quot;microcosm of all the ills in Haitian society: endemic unemployment, illiteracy, non-existent public services, insanitary conditions, rampant crime and armed violence&amp;quot;.[5]&lt;br /&gt;
&lt;br /&gt;
After the 2010 Haiti earthquake, it took nearly two weeks for relief aid to arrive in Cité-Soleil.[6] Although the US military have willingly accepted their new role, their relief efforts have been criticized by some as insufficient.[7]&amp;quot;&lt;/p&gt;

