&amp;quot;This picture shows one of the many settlements that have been set up since the earthquake. This camp has been established in a school playground in Carrefour, one of the worst affected areas on the outskirts of Port-au-Prince. Here, there are approximately 1800 people living in cramped and crowded conditions, many with only a cotton sheet protecting them from the elements.&amp;quot;&lt;br /&gt;
