&lt;p&gt;I'm not sure how to articulate my time in Haiti. I think that is because I am still processing it. I am glad to be home, but my experience there can't help but be life-changing...&lt;br /&gt;
&lt;br /&gt;
On a less serious note, Sanjay Gupta arrived one day with CNN and while he was interviewing some doctors I was in the frame. &lt;a href="http://ac360.blogs.cnn.com/2010/07/13/video-despite-aid-haitian-hospitals-closing/" rel="nofollow"&gt;here's the video&lt;/a&gt; (sec 52-59). Seven seconds of fame! (I also missed Sean Penn, he came to get supplies from the pharmacy, and I saw Anderson Cooper, but missed a photo opp my co-volunteers had - no fair!) Just tops off a crazy trip!&lt;/p&gt;

