&lt;p&gt;&lt;a href="http://www.flickr.com/people/timol/"&gt;Timoluege&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/timol/4727987090/" title="Garbage"&gt;&lt;img src="http://farm2.static.flickr.com/1384/4727987090_995176a04d_m.jpg" width="240" height="180" alt="Garbage" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;With no sewage system and no functioning garbage collection system, solid waste just piles up in the streets where pigs rummage through it.&lt;br /&gt;
&lt;br /&gt;
In addition to being unhygenic and unhealthy, this is also a major flood risk. Solid waste blocks many of the gullies and drainage canals leading to more severe floodings.&lt;/p&gt;

