&lt;p&gt;PORT-AU-PRINCE, Haiti (March 9, 2010) Haitian-American Sailors embarked aboard the Military Sealift Command hospital ship USNS Comfort (T-AH 20) sing Ayiti Cheri (Haiti My Darling) in Creole during a remembrance ceremony for the people of Haiti. The ceremony marked the end of Comfort’s support of Operation Unified Response, during which more than 1,400 nongovernmental volunteers, Sailors and civil mariners aboard the ship provided medical aid to the people of Haiti. (U.S. Navy photo by Mass Communication Specialist 2nd Class Edwardo Proano/Released) 100309-N-4378P-097&lt;/p&gt;

