&lt;p&gt;PORT-AU-PRINCE, Haiti (March 11, 2010) Brazilian army Maj. Gen. Floriano Peixoto Vieira Neto, force commander of the U.N. Stabilization Mission in Haiti, salutes the sideboys as he departs the multipurpose amphibious assault ship USS Bataan (LHD 5) after a visit to meet the crew and tour the ship. Bataan is supporting Operation Unified Response after a 7.0 magnitude earthquake caused severe damage in and around Port-au-Prince Jan. 12. (U.S. Navy photo by Mass Communication Specialist 2nd Class Kelvin Edwards/Released) 100311-N-8655E-025&lt;/p&gt;

