&lt;p&gt;&lt;a href="http://www.flickr.com/photos/vbcityphotographs/4332561445/" title="Haiti Search &amp;amp; Rescue"&gt;&lt;img src="http://farm3.static.flickr.com/2718/4332561445_e7a2e852ed_m.jpg" width="209" height="240" alt="Haiti Search &amp;amp; Rescue" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;January 19, 2010, Port Au Prince, Haiti:&lt;br /&gt;
In mid-January, Virginia Task Force 2 (VATF-2) Urban Search and Rescue Team, based out of Virginia Beach, was activated for deployment in response to the earthquake in Haiti. The 80-person team assembled and departed on two C-17 aircraft.&lt;br /&gt;
&lt;br /&gt;
The mission was to conduct search and rescue operations for victims buried under rubble. The task force’s first save came when they rescued Jens Christensen, a UN worker after an eight-hour rescue operation&lt;br /&gt;
&lt;br /&gt;
(VATF-2 are wearing the white hard hats).&lt;br /&gt;
&lt;br /&gt;
